const list = [];

const initialList = [
  {id: 1, name: "Magnus"},
  {id: 2, name: "Odaaaaa"}
]

const App = () => {
  const [list, setList] = React.useState(initialList);

  return(
    <ul>
      {list.map((item) => (
        <li key={item.id}>{item.name}</li>
      ))}
    </ul>
  );
}

export default App;
